import React from "react";
import { useParams } from "react-router";

function Detail() {
  const { id } = useParams();
  const todos = useSelector((state) => state.todos);

  const todo = todos.filter((todo) => {
    todo.id === id[0];
  });

  return (
    <div>
      {todo.id}
      {todo.title}
      {todo.body}
      {todo.isDone.toString()}
    </div>
  );
}

export default Detail;
